INSERT INTO `event_detail` VALUES (1,790,'ONLINE CODING CONTEST','A great way to improve skills when learning to code is by solving coding challenges. Solving different types of challenges and puzzles can help to become a better problem solver, learn the intricacies of a programming language, prepare for job interviews, learn new algorithms, and more. All the challenges can be solved directly through online. They provide a discussion and leader board for every challenge, and most challenges come with an editorial that explains more about the challenge and how to approach it to come up with a solution.','The code challenge is conducted every weekend and link will be live for 2 days. Here the members show off their computer programming skills. All the team members participate actively to be first in the leader board.','2019-02-10','https://www.hackerrank.com/student-club-coding-contest-1',20),(2,791,'CODING TEST','To make the participants get more familiar with the concepts of programming and problem solving.','This Online Coding Contest is purely based on solving the given problem statements using different programming languages in the Hacker rank Coding Platform.','2019-03-16','https://www.hackerrank.com/contests/student-club-coding-contest-2/leaderboard',20),(3,792,'CODING TEST','To make the participants get more familiar with the concepts of programming and problem solving.  ','This Online Coding Contest is purely based on solving the given problem statements using different programming languages in the Hacker rank Coding Platform.','2019-04-11','https://www.hackerrank.com/contests/cts-students-club/leaderboard',20),(4,793,'CODING CONTEST','To make the participants get more familiar with the concepts of programming and problem solving.  ','This online coding contest is purely based on solving the given problem statements using different programming languages in the hacker rank coding platform.','2019-05-09','https://www.hackerrank.com/contests/cts-student-club-may-month/leaderboard',20),(5,794,'CODING','To make the members get more familiar with the concepts of programming and problem solving.','Description 	The event was conducted online through hacker rank platform.','2019-06-19','https://www.hackerrank.com/cts-june-month-task',10),(6,795,'AUTOMATA','To make the members get used to the Cognizant Specific Challenges and make them more confident in clearing the same.','Description 	The event was conducted online through hackerrank platform.','2019-07-25','Link 	https://www.hackerrank.com/automata-fix',20),(7,796,'CODING TEST','Objective 	To make the members get more familiar with the concepts of programming and problem solving.','Description 	The event was conducted online through hacker rank platform.','2019-07-21','Link 	https://www.hackerrank.com/cts-challenge-1566401038',20),(8,797,'CODING','To make the members get more familiar with the concepts of programming and problem solving.','The event was conducted online through hacker rank platform.','2019-09-28','https://www.hackerrank.com/cts-online-coding-challenge-1',20),(9,798,'FULL STACK DEVELOPER','To make the members develop a project and have the knowledge about the full stack development.','The event was conducted online.','2019-10-05',NULL,20),(10,799,'CODING','To make the members get more familiar with the concepts of programming and problem solving.','The event was conducted online through hacker rank platform.','2019-11-25','https://www.hackerrank.com/cts-coding-challenge',20),(11,800,'ONLINE CODING','To make the members get more familiar with the concepts of programming and problem solving.','The event was conducted online through hacker rank platform.','2019-12-25','https://www.hackerrank.com/cts-online-coding-challenge-1',20),(12,801,'TECHNICAL PRESENTATION','To improve communication skills. To gain knowledge about a technical topic.','The delivery of effective oral presentations is one of the best ways to get your ideas accepted and to develop new opportunities. A good presentation will increase your credibility, enhance your authority as an expert, and most importantly show respect for the audience who is investing their time and effort listening to you. If the objective of a presentation is to get the audience to accept your ideas, then the development and delivery of an effective presentation are among the most important tasks.. The development of an effective presentation requires careful planning, preparation, and delivery. The widespread belief that good presenters are born with this skill is not true. Most of us can learn to be effective presenters through training and experience.','2019-02-15','OS Lab, Bill Gates Block 1st Floor',10),(13,802,'MOCK INTERVIEW','To gain a real time firsthand experience in job interviews, practice and receive suggestions for further improvement.','The mock interview was conducted by three interviewers from the college placement cell and staff from IT department. The candidates were asked to introduced themselves, technical questions were asked about their mini-projects and their are of interest.','2019-03-19','Admin Block, Placement Cell',10),(14,803,'LATEST TECHNOLOGY PRESENTATION','Knowledge is power. Having an excellent knowledge on the trending technologies that are emerging helps one to outshine others in his or her career and to find out one\'s passion. This also helps one to analyze his or her strengths and weaknesses in various areas and select the best field to step into.','The participants were asked to prepare a PowerPoint presentation on the emerging latest technology of their own interest. The various technologies opted by students were  1.	An Introduction to Robotic Process Automation 2.	Upcoming Features of Whatsapp 3.	Introduction to Edge Computing 4.	DNA Computing 5.	Intelligent Applications 6.	Cyber security and Cybercrime 7.	Sniffer for detecting lost mobiles','2019-04-17','https://docs.google.com/forms/d/e/1FAIpQLSdjitvosG3bkDkBhqZz51atrSgBxGN2CCpZHViVPhl2iQp-QA/closedform',20),(15,804,'ONLINE QUIZ','To make the participants get trained with the concepts of programming.','The technical quiz contest was organized in the hacker earth platform.','2019-05-12','https://www.hackerearth.com/challenges/college/test-draft-3-481/',20),(16,805,'QUIZ','To make the members get more familiar with core concepts of Computer Science and C Aptitude.','Description 	The event was conducted online through hackerearth platform.','2019-06-05','http://hck.re/td127111',20),(17,806,'BRANDING','Objective 	To make the members get more knowledge about the latest brands and its naming reason.','Description 	The event was conducted online through Google Froms. ','2019-07-05','Link 	https://forms.gle/BhyvJmqAj7CuFDXf9',20),(18,807,'QUIZ','Objective 	To make the members get aware of the Technical Concepts in Computer Science and Engineering ','Description 	The event was conducted online through hackerrank platform.','2019-08-15','http://hck.re/ca40',20),(19,808,'INDUSTRY APPLICATION','To make the members get more familiar with the Subjective knowledge along with industry application','The event was conducted online','2019-09-18','https://docs.google.com/forms/d/e/1FAIpQLSfCreL-EdBZCNZMhBo85hJsZ_iY8jWK1xkMwBc1INgUPKAheA/viewform?usp=sf_link',20),(20,809,'CODING','To make the members get more familiar with the concepts of programming and problem solving.','The event was conducted online through hacker rank platform.','2019-10-24','https://www.hackerrank.com/cts-coding-challenge',20),(21,810,'QUIZ','To make the members get aware of the Technical Concepts in Computer Science and Engineering ','The event was conducted online through hackerearth platform.','2019-11-15','http://hck.re/td142111',20),(22,811,'ONLINE QUIZ','To make the members get aware of the Technical Concepts in Computer Science and Engineering ','The event was conducted online through hackerearth platform.','2019-12-15','http://hck.re/td142111',20),(23,812,'TECHNICAL DEBATE ','Debating aims at arriving at a conclusive notion about a certain issue, that is to say, in support of or against what the subject matter stands to propose, so as to pertain to development, intellectual logic and the theory of progress. It tests the reasoning skills and helps to enhance interaction.','Technology is a Scourge or a Blessing. ‘Technology’ a ten-letter word which is ruling the world from the time it was invented. Technology has evolved and spread so quickly through all sorts of platforms it has outgrown the control of its creators. This remains an important topic to be discussed and continuing to read the views of every individual in every aspect. However, it is also taking over the lives of irresponsible users. There were different opinions from either side of the teams and pros and cons have been discussed efficiently by every individual.  After some serious discussion and arguments, it gave a conclusion that, “Technology has been and will continue to be a tool to help humanity, but only if we allow it to. Without balance, the very same thing that is helping us could also destroy us”.','2019-02-19','OS Lab, Bill Gates Block, 2nd Floor',10),(24,813,'RELAY CODING','i.	To practice communicating ideas through codes and symbols. ii.	To use teamwork to complete a task. iii.	To verify the work of teammates to ensure a successful outcome.','We divide students into groups of 3-5 and have each group queue up relay-style. We then place an identical pattern at the other side of the room from each team. The first student in line should dash over to the pattern, review it, and write a program to reproduce that pattern. When the given time limit for a person is reached, the first student then runs back and tags the next person in line, then goes to the back of the queue. The next person in line reviews the pattern and reviews the program that has already been written, then either debugs the program by crossing out an incorrect line of code and/or adds a new one. That student then dashes back to tag the next person, and the process continues until one group has finished their program. First group to finish is the winner!','2019-03-15','VB Block, Room no 13',10),(25,814,'USE CASE DESIGN','To understand the scenario given along the functional, non functional requirements, relationship between the system and the components for the development of a Good Software.','Students are grouped into teams of 1-3 members. Four real-time based applications were given, among which a team can choose one application and design the corresponding Use case.  The topics given for the use case design are: 1. Amazon application. 2. Swiggy application. 3. Whatsapp application. 4. Movie Ticket Booking application. 5. Other Innovative ideas.','2019-04-20','The use cases were designed in word/PowerPoint and sent to the mail.',20),(26,815,'ADMIRING PERSONALITY','To know about famous people, their areas of excellence and their way of journey to achieve things.','The event is a presentation on the famous people who has bought a revolution in the industry. Students were asked to form a group of three, and presented on an inspiring person of their choice. Few of the personality chosen by the participants are 1.	Satya Narayana Nadella - CEO of Microsoft. 2.	Kevin Systrom – Instagram CEO. 3.	Elon Reeve Musk – CEO of Tesla. 4.	Binny Bansal – CEO of Flipkart. 5.	Bhavish Aggarwal – CEO of Ola Cabs.','2019-05-21','https://docs.google.com/forms/d/e/1FAIpQLSf9kkSptT7BtisoEmsHZCKSwV6n2Bql5obdjgwxYIFZA4VxSQ/viewform?usp=sf_link',20),(27,816,'APTITUDE','To make the members get more familiar with the Quantitative Analysis and Logical Reasoning.','The event was conducted online through Hackerearth platform.','2019-06-15','https://www.hackerearth.com/challenges/college/mockaptitude/',20),(28,817,'SKILL SET','To make the team members know about their skillset and analyse its pros and cons.','The event was conducted through online forms and  ','2019-07-19','https://docs.google.com/forms/d/e/1FAIpQLSc1rWKuJJNIcyvAQ_fN5VMMZ8TosGpYe62Lf7XDslSx7oRASg/viewform',20),(29,818,'TECHNOLOGY TOOL','To make the audience know about dynamic web – development framework – CodeIgniter','The event was conducted in the campus at the classrooms','2019-08-23','VB Block 4th Floor',10),(30,819,'UI DESIGN','To make the members build creative UI for the specified use case','The participants were made to submit their UIs to the Event coordinator via mail  ','2019-09-20',NULL,20),(31,820,'DREAM ORG','To motivate the club members in achieving their dream big company for building a better career and lifestyle for them to live in.','The event was conducted through Google forms.','2019-10-19','https://forms.gle/9EySDVY6o6rHD79V8',20),(32,821,'WEBSITE','To make the members create website for the Cognizant Student Club tea and share our regular updates.','The event was conducted in Online','2019-11-25','ctsstudentclubvelammal.firebaseapp.com',20),(33,822,'CODETHON','To make the members practice the comprehensive and competitive coding.','The event was conducted online through hackerearth platform.','2019-12-21','https://www.hackerrank.com/cts-codethon',20),(34,823,'PROJECT EXHIBITION ','Encourage the students to implement their idea with complete innovation and technological stack. ','The students were asked to present their projects to the judges. They were evaluated by the CSE department faculty members.','2019-02-05','Bill Gates Block 2nd Floor',10),(35,824,'SQLIZE','To make the participants strong in the concepts of query languages and query optimization.','This Contest is based on solving the given problem statements using different query languages in the Hacker rank Questions asked with marks: a.	Revising the selected query-I =>5 b.	Revising the selected query-II=>5 c.	Japanese cities attribute=>5 d.	Higher than 75=>15 e.	The pads=>30','2019-03-21','https://www.hackerrank.com/contests/sqlizestudentclubcontest-1/leaderboard',20),(36,825,'INTERESTING FACTS','To find whether the participants are aware and knowledgeable about the most promising Service Company to which they are working for as a part of Student Club. ','It’s a presentation event on the topic “Interesting facts about CTS”. All the members were asked to gather some interesting information about CTS and to present it.  ','2019-04-15','https://docs.google.com/forms/d/e/1FAIpQLSeB99TiNADC7Ud5iBZyaMfoVq26qTxiwTdqtOMtiHpKtbGPtg/viewform',20),(37,826,'TECHNICAL TALK SHOW','To enhance the communication skills and to improve the way of thinking in the participants.','The event was based on the technical topic where participants were asked to discuss about the topic and share their opinion.','2019-05-16','A.P.J. Abdul Kalam Block Room No 273',10),(38,827,'PROFILE BUILDING','To encourage the members to build their profiles in various technical forums to improve their network.','The event was conducted online.','2019-06-05',NULL,20),(39,828,'CODING CONTEST','To make the members get more familiar with the concepts of programming and problem solving.','To make the members get more familiar with the concepts of programming and problem solving','2019-07-16','Link 	https://www.hackerrank.com/cts-june-month-task',20),(40,829,'ARTICLE','To test the writing comprehension of t6he students that increases their performance in WET Test','Description 	The event was conducted online through Google forms','2019-08-20','https://docs.google.com/forms/d/e/1FAIpQLSeWvn48vAs9mBSZDe6IObm8zVZukAlxWMylZ1iAYOInGngX2Q/viewform?usp=pp_url',20),(41,830,'CONNECT SESSION','Placement Talk - To make members get the understanding of the Cognizant Interview process. ','The event was conducted onsite in the campus.','2019-09-25','Room No 1 VB Block ',10),(42,831,'APP DEVP','To train the club members to make more useful and productive applications.','The event was conducted online through the http://appinventor.mit.edu/explore/front.html','2019-10-15','http://appinventor.mit.edu/explore/front.html',20),(43,832,'LOGO','To make the members design a creative logo for the Cognizant Student Club','The event was conducted online through Google form','2019-11-18','https://forms.gle/NvhU2LewxZ1PAZQf6',20),(44,833,'APTITUDE','To make the members practice the quantitative aptitude  ','The event was conducted online through google forms platform.','2019-12-21','https://docs.google.com/forms/d/e/1FAIpQLSdPV9SmSU9zm9oFQZui2EKrbbrfTJVjaauqAc4BIZXcHWJe9g/viewform?vc=0&c=0&w=1&usp=mail_form_link',20),(45,834,'TECHNICAL QUIZ','The main object of this quiz is to check the knowledge of the candidate in the field of computer science.','30 MCQ questions with each question have 25 seconds to answer the questions. Every right answer was awarded 1 mark.','2019-02-09','https://www.hackerearth.com/challenges/college/STUDENT-CLUB_QUIZ_CONTEST/',20),(46,835,'TECHNICAL QUIZ','This event was conducted to check how well the participants coordinated with their team mates and answered correctly.','There were 2 rounds. In the first round the questions were from C and in the second round it was from Operating systems. There were 8 teams. Each correct answer was awarded +10 marks and passed questions were awarded +5 marks. The judgement was made based on their final scores.','2019-03-18','VB Block, Room no 13',10),(47,836,'IDEATHON','Innovation is the exploitation of new ideas that lead to the creation of a new products, processes or services. Most importantly, the goal of innovation is to bring the idea to a productive position; whether this is a profitable product or simply a better way of doing something. Innovation is the creation and transformation of new knowledge into new products, processes, or services that meet market needs. As such, innovation creates new businesses and is the fundamental source of growth in business and industry. ','Ideathons are brainstorming events; it consists of max of 3 members in a team. Participants throw in their ideas; present them to get feedback and what they should be working on or how they should go about it. Ideathons are not restricted to one common subject. The participants must submit their ideas in the Google sheet send by the coordinators.','2019-04-22','https://docs.google.com/forms/d/e/1FAIpQLSe2zYm4nuBzvvpLjRJkaeg3PZG3Bosyq ZslAvMi8v6kT__yYg/viewform?usp=pp_url',20),(48,837,'CODING PRACTICE','To improve the competitive coding aspect in the participants. To know more algorithms and problem-solving techniques.','The participants were asked to choose any one of the official programming platform and solve problems regularly and then report to the team leader on a regular basis. Official coding sites: 1.	Six phrase 2.	Skill rack  3.	Hacker rank  4.	Hacker earth 5.	Tech gig 6.	Geek for geeks  7.	Leet code','2019-05-05',NULL,20),(49,838,'NEWSLETTER','To make a magazine about the Cognizant Student Club Activities and increase the editorial skills of the members.','The event was conducted online through Google Forms.','2019-06-15','Link 	https://docs.google.com/forms/d/e/1FAIpQLScQs2cLSG4UzwMCV4vy0vhsAvsJiOcTvB1MO5BzxZVjRI__Lw/viewform?usp=sf_link',20),(50,839,'ENCRYPTION','Objective 	To make the members get more familiar with Cryptographic Algorithms ','Objective 	To make the members get more familiar with Cryptographic Algorithms ','2019-07-20','https://forms.gle/Bo8AdsbsWR7SAjGA6',20),(51,840,'PUZZLES','To make the participants understand the logical puzzles and solve the same using the logical thinking ability ','The event was conducted Online through Google forms','2019-08-20','https://docs.google.com/forms/d/e/1FAIpQLSfXbFE1NRaRyj15jCWEAnw4qp3o1XHNko7WjEhbyrHex6OW9w/viewform?usp=sf_link',20),(52,841,'TALK OUT LOUD','To make the group members discuss about the current technology including its merits and demerits.','The topic about cybersecurity was given and the members were asked to speak about it pros and cons. The topics such as  1.	Haweii ban in USA. 2.	Are mobile phones secure?  3.	 Is Google cloud secure? Were discussed.','2019-09-18','VB Block Room NO 13',10),(53,842,'QUIZ','To make the members get aware of the Technical Concepts in Computer Science and Engineering.','The event was conducted online through hackerearth platform.','2019-10-15','http://hck.re/td13963',20),(54,843,'SEMINAR','Seminar – Machine Learning - The members were given a seminar “Machine Learning”','The event was conducted in the campus','2019-11-25','Room No 7 VB Block',20),(55,844,'TECTHICS','To make the members know the ethical guidelines and practices in the firm','The event was conducted online through Google forms ','2019-12-20','https://forms.gle/89tPStx8bEmVQrXR9',20),(56,845,'5 MINUTE TO CODE','A great way to improve your skills when learning to code is by solving challenges. Solving different types of challenges and puzzles can help you become a better problem solver, learn the intricacies of a programming language, prepare for job interviews, learn new algorithms, and more. And the tricky part is to complete it ON TIME!','The event took place for just 5 minutes. Participants were given 3 questions and was considered eligible for ranking if they’ve solved at least one problem. The room was filled with pressure and enthusiasm in solving the problems.','2019-03-15','VB Block, Room no 13',10),(57,846,'EMAIL WRITING','Email writing is an important aspect that a professional should be well-versed. Email is an important method of communication that is fast, cheap, accessible and easily replicated. Using email can greatly benefit businesses as it provides efficient and effective ways to transmit all kinds of electronic data. So in order to improve the email writing etiquette of the students and to test their communication and vocabulary skills and prepare them to write a professional business mail in the future this Email writing contest is conducted.','Topic: My Journey until now in college The students were asked to send an email on the given topic and they are judged based on the etiquette of the Email. They are scored based on the following criteria, the content of the mail, their grammar and their vocabulary skills are tested through which their message has to be conveyed in a clear intelligible manner.  ','2019-04-16','The Email can be sent through any one of the Email Service Providers such as Gmail, Yahoo mail etc, to the given mail id.',20),(58,847,'CTS RESUME BUILDING','To make the members of the Cognizant Student Club to analyze their performance, inculcating self-evaluation skills.','A form was used to collect the resumes submitted by the participants. Each of the resume has been evaluated with detailed research about every information provided in it.','2019-05-20','https://docs.google.com/forms/d/e/1FAIpQLSfvXeS7WAm0xF8GMjdNR3YKk_r2JMl2_3yV3IUCfbcH_4VMzw/viewform',20),(59,848,'HACKATHON','To make the team members get the knowledge about JDBC and logical thinking for the given problem. ','The event was conducted online. The members were asked to create the  1.	Cab Booking System using OOPS Concepts 2.	Database Transactions using commit and roll back features. ','2019-06-18',NULL,20),(60,849,'GRAPH','To make the team members know about various graphs that exist','The members were asked to learn about various types of graphs and mention the same it through the contest','2019-07-19','https://forms.gle/Uhmsm53iTNbnrYkz7',20),(61,850,'POSTER DESIGN','To bring out the creativity in the team members and also analyse their presence of  mind','The event was conducted online through Google Forms','2019-08-15','https://forms.gle/YB3HYNbjRrUs3kQD9',20),(62,851,'LOGO FINDING','To make the members identify various product logs and their effects.','The event was conducted Online through Google Forms.','2019-09-19','https://docs.google.com/forms/d/e/1FAIpQLScX8t3k-urjJjG_53t5JVMIGUwiE5EJVZJDnXOMeeMblht_fw/viewform?vc=0&c=0&w=1',20),(63,852,'ECARD FOR COGNIZANT','To make the members write down a card on how they feel being a part of this club and share their views on the same ','The event was conducted online','2019-10-20','https://docs.google.com/forms/d/e/1FAIpQLScF41tj8X4OIpxhJFqJ8fwUzAmRIu11rJLDUoudWhce4kRtmA/viewform?usp=sf_link',20),(64,853,'SOFTWARE REVIEW','To make the members review some basic Software that are available in the market to make them more familiarize with the upgrading software evolution. ','The event was conducted in campus to make the members share their view on the software that they found new through internet. ','2019-11-05','VB Block, Room No 4',10),(65,854,'TECHNICAL RESOLUTION','To make the members evolve technically for the upcoming year 2020','The event was conducted online through Google forms ','2019-12-15','https://forms.gle/zcdjpNgbNz5UTQuJA',20),(66,855,'PREDICT THE OUTPUT','To find the output of the given code snippet.','The event was a online event and was conducted in the hackerearth platform. The contest consisted of 10 questions each of 20 marks and a negative mark for the wrong answer. Total time allotted was 30 minutes.','2019-03-23','https://www.hackerearth.com/challenges/college/CTS-STUDENTS-CLUB/leaderboard/',20),(67,856,'LEX PROGRAM CONTEST','As a part of the final semester exams the art of writing a Lex program for various questions was made as events and also the codes were tested against the lexical compilers. ','The participants were asked to send a Lax Program that can be able to validate tokens and generate regular expressions.','2019-04-22','Online Phase (Through Gmail)',20),(68,857,'PPT','To motivate the participants to draft their project work into the document that meets the IEEE standards.','The format of the even as conducted through online and the participants were asked to post their papers for the plagiarism and review check.','2019-05-20','https://forms.gle/cREtTypyA6esNkqF6',20),(69,858,'MINI PROJECT','Objective 	To make the team members get the best out of their innovation.','The members were asked to display their currently ongoing project and were called for the display.','2019-06-27',NULL,10),(70,859,'BLIND CODING','To make the members code without giving the sample input and output.','Description 	The event was conducted online through Hackerrank Platform ','2019-07-24','https://www.hackerrank.com/blind-coding-1563967089',20),(71,860,'PASS OVER JUNIORS ','To take the Cognizant Student Club motto and objective to the immediate juniors and reach out our goals to them','The event aimed at convincing the immediate juniors about the Cognizant Student Club and the exclusive activities we do here','2019-08-10','VB Block – Pre Final Years',10),(72,861,'PERSONALITY FINDING','To make the team members find the given famous personality and enter the same in to the google form.','The event was conducted through online forms. ','2019-09-19','https://forms.gle/oPxmepPbadYatPsr9',20),(73,862,'SEMINAR','The members were given an idea about the agile development and its uses in the industry level.','The event was conducted onsite in the campus.','2019-10-25','Room No 1 VB Block ',10),(74,863,'STOCKS','To make the members aware of the some of the American and Europe Based Software company that produces great evolution in the Technology tie','Description 	The event was conducted online through Google forms ','2019-11-15','Link	https://forms.gle/bb7qJasfV1ufPAjW6',10),(75,864,'REPORT A BUG','To make the members use the applications wise by knowing its merits and limitations and report the same to the ','The event was conducted online through Google forms ','2019-12-15',' https://forms.gle/Ga4Ma7zSRG9rfqPm6',20),(76,865,'GROUP DISCUSSION','To obtain a good amount of experience regarding do’s and don’ts of Group Discussion.','The participants were provided with the topic of “Automation” and were asked to discuss about it.','2019-03-18','VB Block, Room No 13',10),(77,866,'CODEATHON','To conduct event and enunciate a complete coding practice and coding skills for a duration of 3 Hrs and test the patience and interest to code for the participants','The event was conducted in the Hacker Earth platform. There were about 8 problems to solve and all included mathematical and logical reasoning skills.','2019-04-10','https://www.hackerearth.com/challenges/college/test-draft-7-84/leaderboard/',10),(78,867,'ARCHIVE CONTEST','This contest aimed at active participation of the participants for the events.','The contest aimed at collecting documents, photographs and some interesting facts about the CTS Student Club – Velammal Engineering College. The points were awarded based on the contribution to the repository by the students. ','2019-05-05',NULL,20),(79,868,'PERSONALITY TEST','To make the members to know their own strength and weakness.','The event was conducted Online. The members were made to answer hypothetical questions with reasons.','2019-06-19','https://www.hackerrank.com/cts-june-month-task',20),(80,869,'APTITUDE TEST','To make the members get more familiar with the Quantitative Analysis and Logical Reasoning  ','The event was conducted  through google form','2019-07-18','https://docs.google.com/forms/d/e/1FAIpQLSeZPlPSs1wTfcY4f0QtGJhG3o42KSiDiBALNvD5NVaCucbT5g/viewform?vc=0&c=0&w=1',20),(81,870,'BLOG ','Objective 	To make the members get intuitive about the live facts about the club and its progress','Description 	The event was conducted online through Blogspot.com','2019-08-15','Link 	https://cognizantclub.blogspot.com/',20),(82,871,'QUIZ','To make the members get aware of the Technical Concepts in Computer Science and Engineering ','The event was conducted online through hackerrank platform.','2019-09-15','http://hck.re/td13716',20),(83,872,'PORTFOLIO','To encourage the members to build their Github and hackerrank profile and contribute their best to the community.','The event was conducted in Online.','2019-10-25','https://www.hackerrank.com/priyaprem08',20),(84,873,'DIGITAL SOLUTION','Environment Problem and a Digital solution - To make members understand a environmental problem and find a digital solution towards it  ','The event was conducted online through Google Forms','2019-11-20','https://forms.gle/WQv8ay4jAaju6KxN9',20),(85,874,'PHOTOGRAPHY CONTEST','The members were asked to go around the campus and shoot their favourite spot in the campus.','The event was conducted in the campus ','2019-12-04','Velammal Engineering College',10),(86,875,'AUTOMATA FIX','To practice the Cognizant Club Coding and debugging challenges.','This was an Online event hosted on hackerrank platform. It consists of code snippet that has an error coding and also some pattern problems. The target was to give the previous year CTS problems that will be helpful for the students to solve.','2019-03-24','https://www.hackerrank.com/contests/cts-automata-fix/leaderboard',20),(87,876,'STREET CODING SESSION','As future Software Engineers, we are all exposed to coding in a very constrained and pretty good environment. The idea of this event is to, incorporate and show their coding skills without the hindrance of the environment in which they are working in. The students are allowed to code in any public space inside college premises, to impart the idea of Coding without much of a level of conformability.','The event was conducted in our college premises in areas like playground, near libraries etc. A total of two questions were given for the students to solve, the problems included one easy and one medium level problem. The problems were: 1. Hour Glass- Easy Problem- 20 points. 		          2. Form Triangular sum- 20 points.','2019-04-25','The event was conducted at the college premises in areas like Playground, near libraries and hostel areas.',10),(88,877,'SEMINAR','To make the participants aware of the recent concepts in the upcoming Industry 3.0 Revolution.','The topics from various club members were gathered and the most interesting topic was chosen. M. Pritha and R. Anupama prepared the content and M. Pritha delivered the seminar.','2019-05-23','Dr.A.P.J. Abdul Kalam Block E&I Seminar Hall ',10),(89,878,'JUNIOR CONNECT CODING','To make members to interact with the juniors and transfer best knowledge to them.','The event was a class room training conducted by our team to our immediate juniors to give them the glimpse of logical thinking and coding.','2019-06-25','VB BLOCK ROOM NO 6',10),(90,879,'TALK OUT LOUD','To make the group members discuss about the current technology including its merits and demerits.','The topic about cybersecurity was given and the members were asked to speak about it pros and cons. The topics such as  1.	Haweii ban in USA. 2.	Are mobile phones secure?  3.	 Is Google cloud secure? Were discussed.','2019-07-18','VB Block Room NO 13',10),(91,880,'APTITUDE','To make the members get more familiar with the Quantitative Analysis and Logical Reasoning.  ','The event was conducted through Google form','1998-08-17','https://docs.google.com/forms/d/e/1FAIpQLSdqwy5rzNzJBdfUH8onVYr7Q_QCLimlBWljqG7MXOrvgpHq9g/viewform?vc=0&c=0&w=1',20),(92,881,'PYTHON BOOTCAMP','To make the team members familiarize with the python languages from the basics.','The event was conducted in the campus.','2019-09-20','Room No 1 VB Block',10),(93,882,'TED TALK','To motivate the team members to watch the most inspiring TED talks over the internet.','The event was conducted online through Google Forms','2019-10-25','https://www.youtube.com/watch?v=VxuWIXdYYyQ&feature=youtu.be',20),(94,883,'VISION 2020','The members were made to let their ideas based on the upcoming massive change on India’s growth in under the cover VISION 2020.','The event was conducted in Online through Google forms','2019-11-20','https://forms.gle/5meFiGES39wjfwt76',20),(95,884,'OPEN TALK CONTEST','The members were asked to debate the pros and cons of their journey in Velammal Engineering for the past 4 years','The event was conducted in the campus ','2019-12-07',' Bill Gate Block – Velammal Engineering College',10),(96,885,'JUST A MINUTE','To ensure active participation in students to deliver a on spot topic in just one minute.','The event was to encourage the participants work on their speaking skills and improve their knowledge stack. Each participant was given a set of topics and was asked to pick one and 2 minutes of preparation was given. Then the participants were asked to demonstrate their views on the topic for a minute. ','2019-03-22','VB Block, Room no 13',10),(97,886,'ONLINE COURSE','To learn a new Technology and implement the same to solve the creative problem statement.','The online courses were enunciated on some of the programming languages like Python and Ruby, Crypto Currency, Cyber security, and Full stack development.','2019-04-30','udemy',20),(98,887,'CONCRETE CODING SESSION','To develop the functional programming skills in the participants ','The event was conducted in the classroom where the participants were given a problem and was asked to code in their laptops in dev C++ or Turbo C platform and the marks were allotted based on the correctness of the problem.','2019-05-18','E&I Seminar Hall',10),(99,888,'IOT COURSE','To make members get knowledge about the IoT Technology and make projects on the same.','The course was found in Udemy and the members were asked to take the crash course. ','2019-06-05','https://www.udemy.com/share/1005qiAkAccFZaQ3o=/',20),(100,889,'PARSIFIED','Objective 	To make members get to know about the parsing the XML format Data use the same as a data source.','Description 	The event was conducted online through Google Forms','2019-07-21','https://forms.gle/Bo8AdsbsWR7SAjGA6',20),(101,890,'CODETHON','To make the participants solve competitive and logical programming in within the time periods of 2 hrs.','The event was conducted in our campus where the participants were given 10 questions to solve in 2 hrs.','2019-08-25','http://hck.re/ccc11',20),(102,891,'MOCK APTITUDE','To make the members get more familiar with the Quantitative Analysis and Logical Reasoning.','The event was conducted  through google form.','2019-09-18','https: